CREATE TABLE IF NOT EXISTS STUDENTS(
IDS INTEGER  NOT NULL AUTO_INCREMENT, 
PSEUDO VARCHAR(32), 
EMAIL VARCHAR(128), 
PASSWD VARCHAR(10), 
CIVIL CHAR(1), 
LASTNAME VARCHAR(128), 
FIRSTNAME VARCHAR(128), 
STREET1 VARCHAR(512), 
STREET2 VARCHAR(512), 
CITY VARCHAR(256), 
POSTCODE VARCHAR(32), 
DEPARTEMENT VARCHAR(128), 
COUNTRY VARCHAR(128), 
PHONE VARCHAR(32), 
MOBILE VARCHAR(32), 
BIRTHDAY VARCHAR(32), 
CLASSES  VARCHAR(32), 
RM  VARCHAR(32), 
GRADE TINYINT, 
CURRGRADE TINYINT, 
REGISTDATE VARCHAR(32), 
LASTLOGIN VARCHAR(32), 
LASTMODIFY VARCHAR(32), 
COMMENTS VARCHAR(32), 
ISDELETED CHAR(1), 
PRIMARY KEY (IDS), 
UNIQUE(PSEUDO) 
)ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci AUTO_INCREMENT=1;
 

